CREATE TABLE users (
    id SERIAL PRIMARY KEY,
    username VARCHAR(50) NOT NULL UNIQUE,
    email VARCHAR(100) NOT NULL UNIQUE,
    created_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP
);

CREATE TABLE sensors (
    id SERIAL PRIMARY KEY,
    sensor_name VARCHAR(100),
    sensor_type VARCHAR(50),
    installed_at TIMESTAMP DEFAULT NOW()
);


CREATE TABLE sensor_to_user (
    id SERIAL PRIMARY KEY,
    user_id INT NOT NULL,
    sensor_id INT NOT NULL,
    -- Optional: timestamp when association was created
    linked_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
    
    -- Foreign key constraints
    CONSTRAINT fk_user FOREIGN KEY (user_id) REFERENCES users(id) ON DELETE CASCADE,
    CONSTRAINT fk_sensor FOREIGN KEY (sensor_id) REFERENCES sensors(id) ON DELETE CASCADE,
    
    -- Optional: prevent duplicate associations
    UNIQUE (user_id, sensor_id)
);
create table ProsthesisMetrics (
	metric_id INT,
	prosthesis_id INT,
	timestamp DATE,
	force_newtons INT,
	force_direction DECIMAL(4,1),
	acceleration_x INT,
	acceleration_y INT,
	acceleration_z INT,
	temperature_celsius INT,
	battery_level_percent INT
);








